from string import ascii_lowercase, ascii_uppercase
from re import sub

data = """"""

tests = ["""dabAcCaCBAcCcaDA"""]

def run(data):
    diff = abs(ord('a') - ord('A'))
    data = [ord(i) for i in data]
    nextptr = 0
    result = []
    while nextptr < len(data):
        if len(result) == 0:
            result.append(data[nextptr])
            nextptr += 1
        if abs(result[-1] - data[nextptr]) == diff:
            result.pop()
        else:
            result.append(data[nextptr])
        nextptr += 1
    return len(result)

for test in [t for t in tests if t]:
    try: print(run(test))
    except Exception as e: print("Error:",e)
    
print(run(data))
